import React from 'react';
import './App.css';

function App() {

  const [pets, setPets] = React.useState(
    [
      {
        name: 'Luna',
        type: 'cat',
        race: 'Bengal',
        location: 'New Brunswick',
        photo: 'whiteCat.jpeg'
      },
      {
        name: 'Bella',
        type: 'cat',
        race: 'Ragdoll',
        location: 'SaintLuis',
        photo: 'greyCat.jpeg'
      },
      {
        name: 'Daisy',
        type: 'dog',
        race: 'Beagles',
        location: 'League City',
        photo: 'coloredDog.jpeg'
      },
      {
        name: 'Lucy',
        type: 'dog',
        race: 'Poodles',
        location: 'Houston',
        photo: 'whiteDog'
      },
      {
        name: 'Lily',
        type: 'dog',
        race: 'Mudi',
        location: 'Washington',
        photo: 'brownDog.jpeg'
      },
      {
        name: 'Zoe',
        type: 'dog',
        race: 'Husky',
        location: 'Cornwall St',
        photo: 'husky.png'
      },
      {
        name: 'Lala',
        type: 'cat',
        race: 'Persian',
        location: 'Parade Road',
        photo: 'orangeCat.jpeg'
      },
    ]
  )

  return (
    <div className="App">
      <h1>Pets Adoption</h1>

    </div>
  );
}

export default App;
